import React from 'react';
import styled from 'styled-components';
import RecommendContainer from '../../containers/Friends/RecommendContainer';

const ChattingListBlock = styled.div`
  background: black;

  width: 800px;
  height: 600px;
  margin: 0 auto;
`;

const ChattingList = () => {
  return (
    <ChattingListBlock>
      <RecommendContainer />
    </ChattingListBlock>
  );
};

export default ChattingList;
